import{MDBBtn,MDBCard,MDBCardBody,MDBCardImage,MDBCardTitle,MDBCol,MDBCardText, MDBInput,MDBIcon} from 'mdbreact';
import { useEffect, useState } from 'react';

function Login(){
    const[username,setemail]= useState("");

    useEffect(()=>{
        window.addEventListener("email",emailFunction);
        return () => window.removeEventListener("email", emailFunction);
    })

    function emailFunction(event){
        console.log(even.target.value);
        setemail(event.target.value);
    }


    return (
      <div
        style={{ height: "100vh", verticalAlign: "middle" }}
        class="col text-center align-self-center"
      >
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />

        <MDBCol className="row justify-content-center align-self-center">
          <MDBCard
            color="stylish-color"
            style={{ width: "31rem", color: "white" }}
            class="col-xs-1"
          >
            <MDBCardBody>
              <MDBCardTitle>
                <MDBIcon icon="sign-in-alt" /> &nbsp; Log In
              </MDBCardTitle>
              <MDBCardText
                style={{
                  color: "white",
                  alignItems: "center",
                  justifyContent: "center",
                  textAlign: "center",
                }}
              >
                <div
                  className="form-group"
                  style={{
                    alignItems: "center",
                    justifyContent: "center",
                    textAlign: "center",
                  }}
                >
                  <div
                    style={{
                      textAlign: "center",
                      alignContent: "center",
                      justifyContent: "center",
                    }}
                  >
                    <label>
                      <MDBIcon icon="user" /> &nbsp; Email
                    </label>
                    <br />

                    <input
                      type="text"
                      id="Email"
                      className="form-control form-control-md"
                      email
                      required
                      style={{ width: "450px", textAlign: "center" }}
                      onChange={emailFunction}
                    />
                  </div>
                  <br />
                  <label>
                    <MDBIcon icon="key" /> &nbsp; Password
                  </label>
                  <input
                    type="text"
                    id="Password"
                    className="form-control form-control-md"
                    style={{ width: "450px" }}
                    required
                  />
                </div>
              </MDBCardText>
              <MDBBtn color="success" href="#" style={{ width: "350px" }}>
                Login
              </MDBBtn>
            </MDBCardBody>
          </MDBCard>
        </MDBCol>
      </div>
    );
}

export default Login;
